// import Footer from './components/Footer';

class App extends Component{

  render(){

    return(
      <div>
        <Header></Header>
        <div className="row">
          <div className="col-xs-5 col-sm-5 col-md-5 col-lg-5">
            {/* <Product></Product> */}
          </div>
           {showInfoProduc(product)}
        </div>
        {/* <Footer></Footer> */}
      </div>
    )
  }
}

function showInfoProduc(product){
  if(product.status){
    return (
      <h3 className='mg-left-30'>
          ID: {product.id} <br/>
          ID: {product.name} <br/>
          ID: {product.price} <br/>
          ID: {product.status ? "Actice" : "pending"} <br/>
     </h3>
    )
  }
}

export default App;
